gPv(){return"The text is written in a mannered, clear, seriffed, round uncial script in Greek, arranged in one column with 14 lines per page. The scribe used carbon ink, wrote with bilinear letters without rulings or prickings, employing nomina sacra and a cipher for numbers."},
