gPz(){return"\u041d\u0430\u0440\u0430\u0437\u0456 \u043a\u043e\u0434\u0435\u043a\u0441 \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u0454\u0442\u044c\u0441\u044f \u0443 \u0412\u0430\u0442\u0438\u043a\u0430\u043d\u0441\u044c\u043a\u0456\u0439 \u0431\u0456\u0431\u043b\u0456\u043e\u0442\u0435\u0446\u0456 \u0432 \u0420\u0438\u043c\u0456."},
